(714, 'bainouxindi@yahoo.com.tw', '', '61e6288bbc01e4426ede805242a1c47a', 1, 0, 2, NULL, '毛茸茸', '若對我有興趣，請留言給我', '20160321233348512.jpg', 682, 960, NULL, '1997-08-08 00:00:00', '165', '50', 'C', 'bainouxindi@yahoo.com.tw', NULL, '高雄市', '前鎮區', 806, NULL, NULL, NULL, '可商議', '標準', '學生', '設計美術', '大學', NULL, NULL, '單身', '不抽', '不喝', '第一次進入這個網站，也是第一次找這個。\r\n平常的日常生活很簡單，我喜歡旅遊，性格落差比較大，時而安靜，時而活潑，想做一個善良的人。\r\n想找一個有能力的Daddy或Mummy包養我，現在還是學生， 不接受短期伴遊，想找個人包養解决我資金方面的問題。\r\n我是個很乖的女生，如果你對我好，我也會專心的對你好。到了時間我會自己離開，不會打擾你的生活。這是我第一次想被包養，可能會有很多不足，但是我會努力讓你滿意的。\r\n我希望雙方不只是交易，最好能像情人一樣的關係互相欣賞，互相關心，也能保有自己的個人空間，期待有一段讓我心潮澎湃的經歷。', '現在找包養的貌似很多吧 就試試運氣吧 (๑•́ ₃ •̀๑)\r\n希望能找到一個有緣的有經濟實力的會喜歡我的成熟的事業型Daddy或Mummy，我不是死纏爛打的人，也不會提無理的要求。\r\n我沒有甚麼感情經驗，我不算美女，但是長得還行，所以要找美女的話估計我不行，畢竟每個人的眼光不一樣。\r\n想找個長期穩定的、身體健康、無暴力、無任何疾病的。也希望對方没有特殊嗜好 o(╥﹏╥)o\r\n\r\n(因為是學生，所以要求40歲以下，不限男女，但體型不能太胖，沒有非正常嗜好沒有病史)', 'N', 'N', 'N', 'Y', 'N', '2016-03-21 23:25:03', '1.200.63.121', 2, '2016-01-02 12:48:26', NULL, '2016-03-21 23:33:48', NULL),
