(2760, 'yping0937@gmail.com', '', '93922de573a793fd0cf4b60aaa30ae90', 1, 0, 1, NULL, 'ping0937', '陽光男孩', '20160304103644045.png', 680, 841, NULL, '1981-12-25 00:00:00', '178', NULL, NULL, 'yping0937@gmail.com', NULL, '新北市', '新店區', 231, NULL, '2000000', '100~200萬', '可商議', '標準', NULL, '金融交易', '大學', '民生服務', '金融機構', '單身', '不抽', '偶爾喝', '我是ping0937\r\n\r\n是一個不喜歡菸味、偶爾紅酒威士忌、愛乾淨，生活規律的斯文型男孩\r\n\r\n興趣：小說雜誌、電影咖啡茶美食、按摩泡湯、看比賽旅遊單車游泳桌遊\r\n\r\n如果適合，也不排除進一步發展', '想找一個身體與心靈的陪伴\r\n溫習一下約會的甜蜜\r\n不喜歡單純肉體沒有溫度\r\n\r\n偏好雙北的女孩\r\n外貌中上即可，清秀鄰家女孩佳\r\n因為我個人很不喜歡風塵味，所以酒店這些我不碰\r\n有些認為個人條件太相當優秀而索價過高的，小弟我能力不足負擔不起\r\n我很有誠心、也尊重女生，但也請尊重我、彼此不欺騙不隱瞞\r\n\r\n在這裡我打算尋找一個女孩維持穩定的長期關係\r\n想要大約是偽男女朋友般的相處模式\r\n我可能會常常找您僅是看看電影、散散步....之類的\r\n所以找單次的，我們可能不適合喔\r\n\r\n您可以有男友or現在沒有但是積極找男友中，已婚也行\r\n但是不喜歡太混亂的交際 對彼此風險都太高了一些\r\n台北人佳，外地來台北租屋者更佳\r\n(我喜歡自己的家的感覺，所以房租我可以幫忙)\r\n總體來說畢竟主要是看相處的感覺\r\n希望彼此是輕鬆自在無壓力的\r\n初期先互保有隱私不干擾彼此生活，若合拍不排除進一步\r\n\r\n希望大家都能找到理想的陪伴\r\n有個愉快的夜晚......加油\r\n', 'N', 'N', 'N', 'N', 'N', '2016-12-28 11:28:55', '101.138.98.187', 124, '2016-03-03 17:41:21', NULL, '2016-12-28 11:28:55', NULL),
