(5645, 'a19814157@gmail.com', '', 'c789329921de221f0361d5622ee2d23c', 1, 0, 2, NULL, '維納斯20', '歡迎溫柔多金的高階主管快來租我', '20161224210055952.jpg', 400, 300, NULL, '1991-01-01 00:00:00', '164', '46', 'B', 'a19814157@gmail.com', NULL, '台北市', '信義區', 110, NULL, NULL, NULL, '高級', '瘦', '學生', '學生', '大學', NULL, NULL, '單身', '不抽', '不喝', '男主管您好 ~ 我家人住院，急需醫藥費，\r\n還要繳學費，想要被出租，充當您女友，\r\n開心最重要，我晚上上課，六日顧家人，\r\n您需要人陪，我白天可以，不留下個資，\r\n也不簽文件，不做犯法事，不干涉交友，\r\n可隨時分手，原則上第一個月要先拿現金\r\n20萬給我，若尼滿意我，第二個月開始，\r\n每個月1號只要先拿出租現金5萬元給我，\r\n歡迎快聯繫我，保證乾淨衛生安全，也請\r\n男生全程戴套，出租期間不接受錄影.合照\r\n.攝影.錄音...希望互重相處愉快，謝謝 ^^\r\n\r\nPS: 1.出租開始的費用，一律先給我現金再繼續\r\n2.不碰菸酒液賭藥毒槍械，不做任何違法事\r\n3.未經同意絕不做口交.道具.SM.暴力等動作\r\n4.出租期間所需開銷包含房租都由男生付費\r\n5.女生每晚上課不能缺席，請於4點前結束\r\n6.若是單次出租不是月租，請先付現2萬元\r\n7.謝絕沒水準的非高階主管人員，請勿粗言\r\n8.心動就別錯過快加賴約我angel01100518\r\n\r\n歡迎有誠意的您快來約我，請給我當您女友的機會優，記得全程戴套才衛生安全，希望合作愉快\r\n\r\n這真的是單身男生的一大福音啊，\r\n歡迎高階主管們來租我這小甜心', '男主管您好 ~ 我家人住院，急需醫藥費，\r\n還要繳學費，想要被出租，充當您女友，\r\n開心最重要，我晚上上課，六日顧家人，\r\n您需要人陪，我白天可以，不留下個資，\r\n也不簽文件，不做犯法事，不干涉交友，\r\n可隨時分手，原則上第一個月要先拿現金\r\n20萬給我，若尼滿意我，第二個月開始，\r\n每個月1號只要先拿出租現金5萬元給我，\r\n歡迎快聯繫我，保證乾淨衛生安全，也請\r\n男生全程戴套，出租期間不接受錄影.合照\r\n.攝影.錄音...希望互重相處愉快，謝謝 ^^\r\n\r\n平時您還在被同事笑沒女朋友嗎？\r\n假日您還在被朋友虧沒女朋友嗎？\r\n過年過節您還在被家人催結婚嗎？\r\n\r\n我可以讓您帶出門幫您擋子彈唷，\r\n只要出租一個月立即當您女朋友，\r\n每個月1號先給我現金5萬元租金，\r\n\r\n我平日就可以中午陪您到下午4點前，\r\n一起吃飯.聊天.唱歌.看電影.出門走走...\r\n一週見面2次，一個月可見面6次左右，\r\n過年過節還可以陪您出席家庭聚會唷，\r\n您不用再擔心親朋好友說您沒女友囉^^\r\n心動就別錯過快加賴約我angel01100518\r\n', 'N', 'Y', 'N', 'Y', 'N', '2016-12-25 07:19:33', '182.234.221.84', 9, '2016-12-12 08:11:55', NULL, '2016-12-25 07:19:33', NULL),
